// QUnit tests. 
// http://qunitjs.com/

var NATIVE = function(note) { return '[native] ' + (note || 'Passed!'); };
var EXTENSION = function(note) { return '[extension] ' + (note || 'Passed!'); };

// Common test functions

// Add all items together (or concatenate strings).
var AddAllItems = function(total, num) {
  return total + num;
};

// Test error: no seed, no values.
test('empty array; no seed; fn = sum.', function() {
  var arr = [];
  var err = 'Error thrown, Reduce of empty array with no initial value';

  raises(function() {
    var nativeSum = arr.reduce(AddAllItems);
  }, TypeError, NATIVE(err));

  raises(function() {
    var extensionSum = $(arr).reduce(AddAllItems);
  }, TypeError, EXTENSION(err));
});

// Test error: not function.
test('int array; seed; fn is invalid', function() {
  var arr = [4, 8, -8933, 334];
  var err = 'Error thrown, Argument is not a function';
  var notFunctionNull = null;
  var notFunctionObj = {};
  var notFunctionNum = 1337;

  raises(function() {
    var nativeSum = arr.reduce();
  }, TypeError, NATIVE('Testing no function: ' + err));

  raises(function() {
    var extensionSum = $(arr).reduce();
  }, TypeError, EXTENSION('Testing no function: ' + err));

  raises(function() {
    var nativeSum = arr.reduce(notFunctionNull);
  }, TypeError, NATIVE('Testing null as function: ' + err));

  raises(function() {
    var extensionSum = $(arr).reduce(notFunctionNull);
  }, TypeError, EXTENSION('Testing null as function: ' + err));

  raises(function() {
    var nativeSum = arr.reduce(notFunctionObj);
  }, TypeError, NATIVE('Testing object as function: ' + err));

  raises(function() {
    var extensionSum = $(arr).reduce(notFunctionObj);
  }, TypeError, EXTENSION('Testing object as function: ' + err));

  raises(function() {
    var nativeSum = arr.reduce(notFunctionNum);
  }, TypeError, NATIVE('Testing number as function: ' + err));

  raises(function() {
    var extensionSum = $(arr).reduce(notFunctionNum);
  }, TypeError, EXTENSION('Testing number as function: ' + err));
});

test('int array; no seed; fn = sum.', function() {
  var arr = [4, 8, -8933, 334];
  var expectedSum = -8587;

  var nativeSum = arr.reduce(AddAllItems);
  equal(nativeSum, expectedSum, NATIVE());

  var extensionSum = $(arr).reduce(AddAllItems);
  equal(extensionSum, expectedSum, EXTENSION());
});

test('empty array; seed; fn = sum.', function() {
  var arr = [];
  var seed = 57;
  var expectedSum = 57;

  var nativeSum = arr.reduce(AddAllItems, seed);
  equal(nativeSum, expectedSum, NATIVE());

  var extensionSum = $(arr).reduce(AddAllItems, seed);
  equal(extensionSum, expectedSum, EXTENSION());
});

test('empty array; zero seed; fn = sum.', function() {
  var arr = [];
  var seed = 0;
  var expectedSum = 0;

  var nativeSum = arr.reduce(AddAllItems, seed);
  equal(nativeSum, expectedSum, NATIVE());

  var extensionSum = $(arr).reduce(AddAllItems, seed);
  equal(extensionSum, expectedSum, EXTENSION());
});

test('small int array; null seed; fn = sum.', function() {
  var arr = [23, 2, 3];
  var seed = null;
  var expectedSum = 128;

  // Add all items. If seed is null, start it at 100.
  var AddAllItemsInitializeNull = function(total, num) {
    if (total === null) total = 100;
    return total + num;
  };

  var nativeSum = arr.reduce(AddAllItemsInitializeNull, seed);
  equal(nativeSum, expectedSum, NATIVE());

  var extensionSum = $(arr).reduce(AddAllItemsInitializeNull, seed);
  equal(extensionSum, expectedSum, EXTENSION());
});

