// Create <option> list from object array.
test('small object array; seed; fn = html', function() {
  var data = {
    instructor: 'Dr. Leet',
    course: 'hacking 101',
    students: [
      { id: 2, name: 'Amy', gpa: 3.0 },
      { id: 4, name: 'Bob', gpa: 3.5 },
      { id: 7, name: 'Carl', gpa: 4.0 },
      { id: 8, name: 'Doug', gpa: 2.0 },
      { id: 9, name: 'Eve', gpa: 2.5 }
    ]
  };

  var expectedHtml = '<option value="2">Amy</option><option value="4">Bob</option><option value="7">Carl</option><option value="8">Doug</option><option value="9">Eve</option>';

  var createOptionList = function(select, student) {
    return select.append($('<option>', {value: student.id, text: student.name}));
  };

  var nativeList = data.students.reduce(createOptionList, $('<select>'));
  equal(nativeList.html(), expectedHtml, NATIVE());

  var extensionList = $(data.students).reduce(createOptionList, $('<select>'));
  equal(extensionList.html(), expectedHtml, EXTENSION());
});

// Create character historgram data.
test('character array; empty object seed; fn = histogram', function() {
  var text = 'Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Phasellus vel sapien ac orci mattis dictum. Phasellus gravida tempor mi ac porttitor. Vestibulum vitae velit ac risus malesuada lacinia. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Phasellus a felis vitae diam lacinia rutrum. Nullam pulvinar, tortor nec aliquam adipiscing, nisl ligula consequat orci, malesuada accumsan neque mi sit amet sapien. Maecenas non ante sem. Proin enim urna, mollis vel placerat ut, egestas vel lorem. Sed vitae velit lacus, at fringilla risus. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Vivamus sed massa non tellus elementum interdum. Cras nec magna dolor, sit amet sollicitudin diam. Pellentesque viverra neque eu dolor tristique condimentum ac a nulla. Aenean felis tellus, condimentum malesuada tempor sit amet, lacinia a dui.'

  var getCharTotal = function(counts, character) {
    if (/[a-z]/i.test(character)) {
      counts[character] = (counts[character] || 0) + 1;
    }
    return counts;
  };

  var expectedCounts = { 'A': 1, 'C': 3, 'M': 1, 'N': 1, 'P': 6, 'S': 1, 'V': 3,
    'a': 86, 'b': 7, 'c': 33, 'd': 19, 'e': 87, 'f': 5, 'g': 7, 'h': 5, 'i': 76,
    'l': 56, 'm': 40, 'n': 48, 'o': 32, 'p': 16, 'q': 10, 'r': 39, 's': 66, 
    't': 64, 'u': 57, 'v': 13 };

  var nativeCounts = text.split('').reduce(getCharTotal, {});
  deepEqual(nativeCounts, expectedCounts, NATIVE('Char counts equal.'));

  var extensionCounts = $(text.split('')).reduce(getCharTotal, {});
  deepEqual(extensionCounts, expectedCounts, EXTENSION('Char counts equal.'));
});


